import React from 'react';
import styled from 'styled-components';

const ActivitiesDiv =styled.div`
    width:15%;
    height:15%;
    position:flex;
    background: white;
    border-radius:16px;
    border-color:black;
`;

const Activities =({imgsrc,description})=>{
    return(
      <ActivitiesDiv >
          <img src={imgsrc} style={{width:'15%',height:'15%'}}/>
          <p>{description}</p>
      </ActivitiesDiv>
    );
};
export default Activities;
